    <script type="text/javascript">
      const pyodideWorker = new Worker("./Demo_Embedding_Dashboard_standalone.js");
      pyodideWorker.busy = false
      pyodideWorker.queue = []
      
      let patching = 0
      
      function send_change(jsdoc, event) {
        if ((event.setter_id != null && event.setter_id == 'py') || (patching > 0)) {
          return
        } else if (pyodideWorker.busy && event.model && event.attr) {
          let events = []
          for (const old_event of pyodideWorker.queue) {
            if (!(old_event.model === event.model && old_event.attr === event.attr)) {
              events.push(old_event)
            }
          }
          events.push(event)
          pyodideWorker.queue = events
          return
        }
        const patch = jsdoc.create_json_patch([event])
        pyodideWorker.busy = true
        pyodideWorker.postMessage({type: 'patch', patch: patch})
      }
      
      pyodideWorker.onmessage = async (event) => {
        const msg = event.data
      
        const body = document.getElementsByTagName('body')[0]
        const loading_msgs = document.getElementsByClassName('pn-loading-msg')
        if (msg.type === 'idle') {
          if (pyodideWorker.queue.length) {
            const patch = pyodideWorker.jsdoc.create_json_patch(pyodideWorker.queue)
            pyodideWorker.busy = true
            pyodideWorker.queue = []
            pyodideWorker.postMessage({type: 'patch', patch: patch})
          } else {
            pyodideWorker.busy = false
          }
        } else if (msg.type === 'status') {
          let loading_msg
          if (loading_msgs.length) {
            loading_msg = loading_msgs[0]
          } else if (body.classList.contains('pn-loading')) {
            loading_msg = document.createElement('div')
            loading_msg.classList.add('pn-loading-msg')
            body.appendChild(loading_msg)
          }
          if (loading_msg != null) {
            loading_msg.innerHTML = msg.msg
          }
        } else if (msg.type === 'render') {
          const docs_json = JSON.parse(msg.docs_json)
          const render_items = JSON.parse(msg.render_items)
          const root_ids = JSON.parse(msg.root_ids)
      
          // Remap roots in message to element IDs
          const root_els = document.querySelectorAll('[data-root-id]')
          const data_roots = []
          for (const el of root_els) {
             el.innerHTML = ''
             data_roots.push([el.getAttribute('data-root-id'), el.id])
          }
          data_roots.sort((a, b) => a[0]<b[0] ? -1: 1)
          const roots = {}
          for (let i=0; i<data_roots.length; i++) {
            roots[root_ids[i]] = data_roots[i][1]
          }
          render_items[0]['roots'] = roots
          render_items[0]['root_ids'] = root_ids
      
          // Clear pre-rendered contents
          Bokeh.index.roots.map((v) => v.remove())
      
          // Embed content
          const [views] = await Bokeh.embed.embed_items(docs_json, render_items)
      
          // Remove loading spinner and message
          body.classList.remove("pn-loading", "arc")
          for (const loading_msg of loading_msgs) {
            loading_msg.remove()
          }
      
          // Setup bi-directional syncing
          pyodideWorker.jsdoc = jsdoc = [...views.roots.values()][0].model.document
          jsdoc.on_change(send_change.bind(null, jsdoc), false)
          pyodideWorker.postMessage({'type': 'rendered'})
          pyodideWorker.postMessage({'type': 'location', location: JSON.stringify(window.location)})
        } else if (msg.type === 'patch') {
          try {
            patching += 1
            pyodideWorker.jsdoc.apply_json_patch(msg.patch, msg.buffers)
          } finally {
            patching -= 1
          }
        }
      };
    </script>

fore, .pn-loading:before {\n  background-color: #c3c3c3;\n  mask-size: auto calc(min(50%, 400px));\n  -webkit-mask-size: auto calc(min(50%, 400px));\n}",{"id":"p1006"},{"id":"p1314"}],"width":480,"min_width":480,"margin":[5,10],"align":["center","center"],"text":"&amp;lt;img src=&amp;quot;https://raw.githubusercontent.com/nimh-sfim/manifold_learning_fmri/master/docs/images/Embedding_GUI_Intro.png&amp;quot;  style=&amp;quot;max-width: 100%; max-height: 100%; object-fit: contain; width: 480px; height: auto;&amp;quot;&amp;gt;&amp;lt;/img&amp;gt;"}},{"type":"object","name":"panel.models.markup.HTML","id":"p1038","attributes":{"css_classes":["markdown"],"stylesheets":["\n:host(.pn-loading):before, .pn-loading:before {\n  background-color: #c3c3c3;\n  mask-size: auto calc(min(50%, 400px));\n  -webkit-mask-size: auto calc(min(50%, 400px));\n}",{"id":"p1006"},{"id":"p1014"},{"id":"p1314"}],"width":650,"min_width":650,"margin":[5,10],"align":"start","text":"&amp;lt;p&amp;gt;This dashbaord allows you to explore time-vayring fMRI data embedded using &amp;lt;a href=&amp;quot;https://en.wikipedia.org/wiki/T-distributed_stochastic_neighbor_embedding&amp;quot;&amp;gt;T-SNE&amp;lt;/a&amp;gt;, &amp;lt;a href=&amp;quot;https://umap-learn.readthedocs.io/en/latest/&amp;quot;&amp;gt;UMAP&amp;lt;/a&amp;gt; and &amp;lt;a href=&amp;quot;https://scikit-learn.org/stable/modules/generated/sklearn.manifold.SpectralEmbedding.html&amp;quot;&amp;gt;Laplacian Eigenamps&amp;lt;/a&amp;gt;.&amp;lt;/p&amp;gt;\n&amp;lt;p&amp;gt;All details about this work can be found in &amp;lt;a href=&amp;quot;https://www.frontiersin.org/journals/human-neuroscience/articles/10.3389/fnhum.2023.1134012/full&amp;quot;&amp;gt;our scientific publication&amp;lt;/a&amp;gt; in the journal &amp;lt;a href=&amp;quot;https://www.frontiersin.org/journals/human-neuroscience&amp;quot;&amp;gt;Frontiers in Human Neuroscience&amp;lt;/a&amp;gt;.&amp;lt;/p&amp;gt;\n&amp;lt;p&amp;gt;In a nutshell, fMRI data was acquired for 25 minutes as subjects performed four different cognitive tasks (visual attention, 2-back working memory, simple math and rest). Using the &amp;lt;a href=&amp;quot;https://onlinelibrary.wiley.com/doi/10.1002/hbm.21333&amp;quot;&amp;gt;Craddock atlas&amp;lt;/a&amp;gt;, and a &amp;lt;a href=&amp;quot;https://www.sciencedirect.com/science/article/pii/S1053811919300874?via%3Dihub&amp;quot;&amp;gt;sliding window&amp;lt;/a&amp;gt; apporach we generated whole-brain, time-varying functional connectivity matrices (left). These are high dimensional matrices (edges X time); and therefore hard to interpret. To evaluate if Manifold Learning can aid with interpretation, we constructed embeddings and checked how well they capture the task structue of the experiment.&amp;lt;/p&amp;gt;\n&amp;lt;p&amp;gt;Use, the widgets on the right sidebar to select input data. Use the widgets in each of the tabs below to see how technique specific hyperparameters affect the quality of the embedding and their ability to show the task structure. Have fun!!!!&amp;lt;/p&amp;gt;\n"}}]}}]]]},"data":{"type":"object","name":"FloatPanel1","id":"p1031","attributes":{"name":"Introduction and basic instructions","config":{"type":"map","entries":[["headerControls",{"type":"map","entries":[["close","remove"],["maximize","remove"]]}]]}}},"html":"\n&amp;lt;div id=&amp;quot;float-${id}&amp;quot; class=&amp;quot;bk-root&amp;quot; style=&amp;quot;padding:8px;padding-right:30px&amp;quot;&amp;gt;\n\n  &amp;lt;div id=&amp;quot;flex-item-0-${id}&amp;quot;&amp;gt;&amp;lt;/div&amp;gt;\n\n&amp;lt;/div&amp;gt;\n","looped":["flex-item"],"nodes":["float","flex-item-0"],"scripts":{"type":"map","entries":[["render",["if (state.panel) {\n  view.run_script(&amp;#x27;close&amp;#x27;)\n}\nvar config = {\n  headerTitle: data.name,\n  content: float,\n  theme: data.theme,\n  id: &amp;#x27;jsPanel&amp;#x27;+data.id,\n  position: view.run_script(&amp;#x27;get_position&amp;#x27;),\n  contentSize: `${model.width} ${model.height}`,\n  onstatuschange:
